	        var curScale = 1.0 * (curSlide - widget.info.minValue) / (widget.info.maxValue - widget.info.minValue);

	        curScale = curScale >= 0 ? curScale : 0.0;
	        curScale = curScale <= 1 ? curScale : 1.0;
	        widget.curSlide = curSlide;
